import Vue from 'vue';
import Vuex from 'vuex'


Vue.use(Vuex);

export const store=new Vuex.Store({
    state:{
        members:[
            {name:'Apple',price:20},
            {name:'Mango',price:40}
        ]
    },

    getters:{
        allmembers:(state)=>state.members
    },
        })
